import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import WeaponList from "./components/WeaponList";

function App() {
  return (
    <div>
      <Header />
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(2, 1fr)",
          gap: "12px",
          paddingBottom: "16px",
        }}
      >
        <WeaponList />
        <WeaponList />
      </div>
      <Footer />
    </div>
  );
}

export default App;
